import Container from 'react-bootstrap/Container';

const Navbar = prop => {
  return (
    <Navbar>
      <Container>
        <Navbar.Brand href="#home">Chatroom</Navbar.Brand>
        <Navbar.Toggle />
        <Navbar.Collapse className="justify-content-end">
          <Navbar.Text>
            Signed in as: <a href="#login">prop.username</a>
          </Navbar.Text>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default Navbar;
